import { NavLink } from "react-router-dom";

const CutData = (props) => {
  return (
    <ul className="App">
      <NavLink to="/src/components/Data.js">
        <li
          onClick={() => {
            props.updateData(props.index);
          }}
        >
          {props.CutData}
        </li>
      </NavLink>
    </ul>
  );
};

export default CutData;
